import React from 'react';
import {Link} from 'react-router-dom';
import image1 from '../Assets/image1.png';
import image2 from '../Assets/image2.png';

function App() {

  return (
    <div className="wrapper">
        <main>
            <h1>De-catastrophize your thoughts.</h1>
            <div className="icon">
                <img src={image1} alt="image1"/>
            </div>
            <p>Catastrophizing refers to when we start imagining the worst case scenarios, when we're met with 
               genuine setbacks.</p>
            <div className="icon">
                <img src={image2} alt="image2"/>
            </div>
            <Link to = "/ThoughtForm">Continue</Link>
        </main>
    </div>
  );
}

export default App;
